import React from 'react';
import ListPerso from '../ListPerso/ListPerso';
import Infos from '../Infos/Infos';
import Search from '../Search/Search';

class Home extends React.Component {
    render () {
        return (
            <div className='home'>
                <Search />
                <ListPerso />
                <Infos />
            </div>
        );
    }
}

export default Home;
